import axios from 'axios'
import { GET_ALL_PARENTS } from '../types'


export const getAllParents =()=> dispatch => {
    axios.get("http://localhost:8080/parent/all")
    .then(response => {
        console.log("ALL STUDENTS")
        dispatch({
            type: GET_ALL_PARENTS,
            payload: response.data
        })
    })
}
